import React, { useState } from "react";
import { useEffect } from "react";
import { Doughnut } from "react-chartjs-2";
import { Chart, registerables,ArcElement } from "chart.js";
Chart.register(...registerables);
Chart.register(ArcElement);

const DoughnutChart = () => {
  const [data, setData] = useState({
    labels: ["State 1", "State 2", "State 3", "State 4", "State 5", "State 6" , "State 7", "State 8", "State 9", "State 10"],
    datasets: [
      {
        data: [5, 8, 4, 4, 8, 11, 2, 7, 5, 6],
        backgroundColor: [
          "rgba(255, 99, 132)",
          "rgba(54, 162, 235)",
          "rgba(255, 206, 86)",
          "rgba(75, 192, 192)",
          "rgba(153, 102, 255)",
          "rgba(60, 179, 113)",
          "rgba(210, 210, 210)",
          "rgba(106, 90, 205)",
          "rgba(255, 99, 71)",
          "rgba(255, 165, 0)",

        ],
        hoverBackgroundColor: [
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
          "rgb(255,255,255)",
        ],
      },
    ],
  });



  return (
    <div className="Dooughnut" style={{ height: '30%' , width:'30%'}}>
      <Doughnut data={data} options={{ maintainAspectRatio: true }} />
    </div>
  );
};

export default DoughnutChart;
